import React from "react";
import "bootstrap/dist/css/bootstrap.css";

const Movies = (props) => {
  const { data } = props;

  return (
    <ul>
      {console.log("movie.jsx data " + data)}
      {data.map((m) => {
        return (
          <list key={m.id}>
            <img src={m.poster_path} alt={m.title} />
          </list>
        );
      })}
    </ul>
  );
};

export default Movies;
